// src/components/PartTimeJobPage.jsx
import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

function PartTimeJobPage() {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    qualification: "",
    isIndian: "yes",
    country: "",
    isStudent: "yes",
    college: "",
    age: "",
    nightShift: "no",
    location: "",
    jobRole: "",
    timing: "",
    salary: ""
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    navigate("/job-results", { state: formData });
  };

  return (
    <div style={{ maxWidth: "600px", margin: "auto", padding: "20px" }}>
      <h2>Find Part-Time Jobs</h2>
      <form onSubmit={handleSubmit}>
        <label>Qualification:</label>
        <input type="text" name="qualification" onChange={handleChange} required />

        <label>Are you Indian?</label>
        <select name="isIndian" onChange={handleChange}>
          <option value="yes">Yes</option>
          <option value="no">No</option>
        </select>

        {formData.isIndian === "no" && (
          <>
            <label>Which Country?</label>
            <input type="text" name="country" onChange={handleChange} required />
          </>
        )}

        <label>Are you a student?</label>
        <select name="isStudent" onChange={handleChange}>
          <option value="yes">Yes</option>
          <option value="no">No</option>
        </select>

        {formData.isStudent === "yes" && (
          <>
            <label>College/University Name:</label>
            <input type="text" name="college" onChange={handleChange} required />
          </>
        )}

        <label>Age:</label>
        <input type="number" name="age" onChange={handleChange} required />

        <label>Comfortable with night shift?</label>
        <select name="nightShift" onChange={handleChange}>
          <option value="no">No</option>
          <option value="yes">Yes</option>
        </select>

        <label>Preferred Location:</label>
        <input type="text" name="location" onChange={handleChange} required />

        <label>Preferred Job Role:</label>
        <select name="jobRole" onChange={handleChange}>
          <option value="">--Select--</option>
          <option value="Tutor">Tutor</option>
          <option value="Delivery">Delivery</option>
          <option value="Cafe Staff">Cafe Staff</option>
          <option value="Intern">Intern</option>
        </select>

        <label>Preferred Timing:</label>
        <input type="text" name="timing" placeholder="e.g. 5-9 PM" onChange={handleChange} required />

        <label>Salary Expectation (â‚¹):</label>
        <input type="number" name="salary" onChange={handleChange} required />

        <button type="submit">Find Jobs</button>
      </form>
    </div>
  );
}

export default PartTimeJobPage;
